/**
 * Author: Sami Haddad
 * Date Created: 8/23/2022
 * Last Modified: 8/24/2022
 */

import React from 'react';
import './Contact.css';

export default function Contact() {
	return <div className={'contactInfoContainer'}>
		<h2 className='contactInfoHeader'>Contact Information</h2>
		<p className='contactInfoField'>Email: Haddad0@sheridancollege.ca</p>
		<p className='contactInfoField'>Phone Number: (905)330-9867</p>
		<p className='contactInfoField'><a href="https://github.com/samihaddad99/samihaddad99">GitHub Profile</a></p>
		<p className='contactInfoField'><a href="https://www.linkedin.com/in/samihaddad99/">LinkedIn Profile</a></p>
	</div>;
}
